**Project Structure:**

Create a new Unity3D project with the following structure:

* **Assets**
	+ **Scenes**: `PlatformerScene.unity`
	+ **Scripts**: `PlayerController.cs`, `Platform.cs`, `Coin.cs`, `Enemy.cs`
	+ **Sprites**: `player.png`, `platform.png`, `coin.png`, `enemy.png`
	+ **Materials**: `DefaultMaterial.mat`

**Code Files:**

### PlayerController.cs:
```csharp using UnityEngine;

public class PlayerController : MonoBehaviour {
    public float moveSpeed = 5f;
    public float jumpForce = 10f;
    private Rigidbody2D rb;
    private bool isJumping = false;

    void Start() {
        rb = GetComponent<Rigidbody2D>();
    }

    void Update() {
        float horizontalInput = Input.GetAxis("Horizontal");
        float verticalInput = Input.GetAxis("Vertical");

        Vector2 movement = new Vector2(horizontalInput, verticalInput);

        if (movement!= Vector2.zero) {
            rb.velocity = new Vector2(movement.x * moveSpeed, rb.velocity.y);
        }

        if (Input.GetButtonDown("Jump") &&!isJumping) {
            rb.AddForce(Vector2.up * jumpForce, ForceMode2D.Impulse);
            isJumping = true;
        }
    }

    void OnCollisionEnter2D(Collision2D collision) {
        if (collision.gameObject.CompareTag("Platform")) {
            isJumping = false;
        }
    }
}
```

